script: |
  super -f text -I q9071.spq | sort > q9071.out

inputs:
  - name: q9071.spq
    data: |
      SELECT DISTINCT + 70 * col1 AS col0 FROM tab0 (FORMAT parquet) WHERE + col1 NOT BETWEEN ( + 64 * 21 + 88 ) AND - 50;
  - name: tab0

outputs:
  - name: q9071.out
    data: |
      1470
      5670
      70
